import React from "react";
import { MDBContainer, MDBIframe } from "mdbreact";

const IframePage = () => {
  return (
    <MDBContainer className="text-center">
      <MDBIframe src="https://www.google.com/maps/dir/19.413119,72.8375756/eversmile+dental/@19.4083329,72.8323911,16z/data=!3m1!4b1!4m9!4m8!1m1!4e1!1m5!1m1!1s0x3be7a97f704ca6e7:0xc61be7734f93019e!2m2!1d72.8393532!2d19.4044705" />
    </MDBContainer>
  );
}

export default IframePage;
